import React from 'react';
import { useNavigate } from 'react-router-dom';
import { styled } from 'styled-components';

const Home = () => {
  const navigate = useNavigate();

  onClick = () => {
    navigate('/login');
  };

  return (
    <>
      <div>Home</div>
      <button>login</button>
    </>
  );
};

export default Home;
